import React from 'react';


function ShowCurrentActivity({current, user}) {
  return (
    <div>
      <h2>{`User #${user}`}</h2>
      What am I doing right now?<br/>

      <p>{current}</p>

<hr/>

    </div>
  );
}

export default ShowCurrentActivity;
